  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SP_REG"."RG_VW_EMP_BRANCHES" ("RG_EBR_EMP_SEPE_ID", "RG_EBR_BRANCH_ID", "RG_EBR_MAIN_STAKOD", "RG_EBR_SEPE_ORG_ID", "RG_EBR_KALLIKRATIS", "RG_EBR_EMPLOYER_ID", "RG_EBR_EMPLOYER_BRANCH_ID", "RG_EBR_MAIN_BRANCH_FLAG", "RG_EBR_EMPLOYEE_NO", "RG_EBR_SEASONAL_FLAG", "RG_EBR_ORGBRA_BRANCH_CODE", "RG_EBR_EMPLOYER_BRANCH_STATUS", "RG_EBR_ADDRESS_STREET", "RG_EBR_NO", "RG_EBR_ZIP_CODE", "RG_EBR_CITY", "RG_EBR_CNTY_COUNTY_CODE", "RG_EBR_PHONE_NUMBER", "RG_EBR_SECOND_PHONE_NUMBER", "RG_EBR_FAX_NUMBER", "RG_EBR_EMAIL", "RG_EBR_CENSUS_DATE", "RG_EBR_SEC_STAKOD_1", "RG_EBR_SEC_STAKOD_2", "RG_EBR_SEC_STAKOD_3", "RG_EBR_SEC_STAKOD_4", "RG_EBR_SEC_STAKOD_5") AS 
  SELECT rgemb.rg_ebr_emp_sepe_id,
          rgemb.rg_ebr_BRANCH_ID,
          rgemb.rg_ebr_MAIN_STAKOD,
          rgemb.rg_ebr_SEPE_ORG_ID,
          rgemb.rg_ebr_kallikratis,
          ikemb.IK_EBR_EMPLOYER_ID AS RG_EBR_EMPLOYER_ID,
          ikemb.IK_EBR_EMPLOYER_BRANCH_ID AS RG_EBR_EMPLOYER_BRANCH_ID,
          ikemb.IK_EBR_MAIN_BRANCH_FLAG AS RG_EBR_MAIN_BRANCH_FLAG,
          ikemb.IK_EBR_EMPLOYEE_NO AS RG_EBR_EMPLOYEE_NO,
          ikemb.IK_EBR_SEASONAL_FLAG AS RG_EBR_SEASONAL_FLAG,
          ikemb.IK_EBR_ORGBRA_BRANCH_CODE AS RG_EBR_ORGBRA_BRANCH_CODE,
          ikemb.IK_EBR_EMPLOYER_BRANCH_STATUS
             AS RG_EBR_EMPLOYER_BRANCH_STATUS,
          ikemb.IK_EBR_ADDRESS_STREET AS RG_EBR_ADDRESS_STREET,
          ikemb.IK_EBR_NO AS RG_EBR_NO,
          ikemb.IK_EBR_ZIP_CODE AS RG_EBR_ZIP_CODE,
          ikemb.IK_EBR_CITY AS RG_EBR_CITY,
          ikemb.IK_EBR_CNTY_COUNTY_CODE AS RG_EBR_CNTY_COUNTY_CODE,
          ikemb.IK_EBR_PHONE_NUMBER AS RG_EBR_PHONE_NUMBER,
          ikemb.IK_EBR_SECOND_PHONE_NUMBER AS RG_EBR_SECOND_PHONE_NUMBER,
          ikemb.IK_EBR_FAX_NUMBER AS RG_EBR_FAX_NUMBER,
          ikemb.IK_EBR_EMAIL AS RG_EBR_EMAIL,
          ikemb.IK_EBR_CENSUS_DATE AS RG_EBR_CENSUS_DATE,
          RG_EBR_SEC_STAKOD_1,
          RG_EBR_SEC_STAKOD_2,
          RG_EBR_SEC_STAKOD_3,
          RG_EBR_SEC_STAKOD_4,
          RG_EBR_SEC_STAKOD_5
     FROM ik_employer_branches ikemb,
          rg_vw_employer rgemp,
          rg_emp_branches rgemb
    WHERE     ikemb.IK_EBR_EMPLOYER_ID = rgemp.rg_emp_employer_id
          AND rgemp.rg_emp_sepe_id = rgemb.rg_ebr_emp_sepe_id
          AND rgemb.rg_ebr_BRANCH_ID = ikemb.IK_EBR_EMPLOYER_BRANCH_ID
 ;
