  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SP_REG"."RG_VW_TA_REG" ("RG_TA_DOC_ID", "RG_TA_TYPE_CODE", "RG_TA_TYPE_DESC", "RG_TA_SURNAME", "RG_TA_NAME", "RG_TA_FATHER_NAME", "RG_TA_TAXATION_NUMBER", "RG_TA_AMKA", "RG_TA_ID_TYPE_CODE", "RG_TA_ID_TYPE_DESC", "RG_TA_ID_NUMBER", "RG_TA_EMAIL", "RG_TA_PHONE_NUMBER", "RG_TA_MOBILE", "RG_TA_FAX", "RG_TA_ADDRESS_STREET", "RG_TA_ADDRESS_TK", "RG_TA_MUNICIPAL_CODE", "RG_TA_MUNICIPAL_DESC", "RG_TA_COMMUN_CODE", "RG_TA_COMMUN_DESC", "RG_TA_COUNTY_CODE", "RG_TA_COUNTY_DESC", "RG_TA_REGION_CODE", "RG_TA_REGION_DESC", "RG_TA_UNION_NUMBER", "RG_TA_EDUCATION_LEVEL_CODE", "RG_TA_EDUCATION_LEVEL_DESC", "RG_TA_SPECIALTY_CODE", "RG_TA_SPECIALTY_DESC", "RG_TA_NEZ_DUTIES_FLAG", "RG_TA_TRAINING_100_FLAG", "RG_TA_TRAINING_35_FLAG", "RG_TA_TRAINING_ME_FLAG", "RG_TA_PROFILE_CHECK_FLAG", "RG_TA_REGISTRATION_DATE", "RG_TA_STATUS_CODE", "RG_TA_STATUS_DESC", "RG_TA_SEPE_DEPARTMENT_CODE", "RG_TA_SEPE_DEPARTMENT_DESC") AS 
  SELECT
    ID,
    
    A.P_FLD1,
    'ΤΕΧΝΙΚΟΣ ΑΣΦΑΛΕΙΑΣ',
    
    A.P_FLD2,
    A.P_FLD3,
    A.P_FLD4,
    A.P_FLD5,
    A.P_FLD6,
    
    'ΔAT',
    'ΔΕΛΤΙΟ ΑΣΤΥΝΟΜΙΚΗΣ ΤΑΥΤΟΤΗΤΑΣ',
    
    A.P_FLD7,
    A.P_FLD8,
    A.P_FLD9,
    A.P_FLD10,
    A.P_FLD11,
    
    A.P_FLD12,
    --
    A.P_FLD13,
    
    --P_FLD14,
    TA_KALL.sp_rtkal_commun_code, 
    TA_KALL.sp_rtkal_commun_descr,
    TA_KALL.sp_rtkal_municipal_code, 
    TA_KALL.sp_rtkal_municipal_descr,
    TA_KALL.sp_rtkal_county_code, 
    TA_KALL.sp_rtkal_county_descr,
    TA_KALL.sp_rtkal_region_code, 
    TA_KALL.sp_rtkal_region_descr,

    A.P_FLD15,
    
    A.P_FLD16,
    TA_EDUC.SP_EDU_DESC,
    
    A.P_FLD17,
    TA_SPEC.SP_TASP_DESC,
    
    A.P_FLD18,
    A.P_FLD19,
    A.P_FLD20,
    0, --rg_ta_training_me_flag
    A.P_FLD21,
    A.P_FLD22,
    
    A.P_FLD23,
    'ΕΝΕΡΓΟ',
    
    A.P_FLD24,
    TA_DEP.hr_dept_descr


FROM sp_int.w010_data a LEFT OUTER JOIN sp_rt_kallikratis TA_KALL ON A.p_fld14 = TA_KALL.sp_rtkal_commun_code 
    LEFT OUTER JOIN sp_rt_educ_level TA_EDUC on a.p_fld16 = TA_EDUC.SP_EDU_ID
    LEFT OUTER JOIN SP_RT_TA_SPECIALITY TA_SPEC on a.p_fld17 = TA_SPEC.SP_TASP_ID
    LEFT OUTER JOIN  HR_VW_DEPARTMENTS TA_DEP on A.P_FLD24 = DECODE(TA_DEP.hr_dept_cd,'-',0,TA_DEP.hr_dept_cd);
